const {
    client
} = require('nightwatch-api');
const {
    Given,
    Then
} = require('cucumber');

Given('I open Google`s search page', function () {
    return client.url('http://google.com');
});

Given('I open DuckDuckGo search page', function () {
    return client.url('https://duckduckgo.com/');
});

Then('the title is {string}', function (text) {
    return client.assert.title(text);
});

Then('the DuckDuckGo search form exists', function () {
    return client.assert.visible('input[name="q"]');
});

Then('the Google search form exists', function () {
    return client.assert.visible('input[name="q"]');
});
